			shellScript = "set -e\nPRODUCT_PATH=\"${SYMROOT}/Release/Analytics.framework\"\n\n## Prepare the framework Folder Structure\n\nmkdir -p \"${PRODUCT_PATH}/Versions/A/Headers\"\n# Link the \"Current\" version to \"A\"\n/bin/ln -sfh A \"${PRODUCT_PATH}/Versions/Current\"\n/bin/ln -sfh Versions/Current/Headers \"${PRODUCT_PATH}/Headers\"\n/bin/ln -sfh Versions/Current/Analytics \"${PRODUCT_PATH}/Analytics\"\n\n## Compile for both iPhone (armv7, armv7s) and iPhone Simulator (i386)\n\nxcodebuild -workspace Analytics.xcworkspace -scheme Analytics -configuration Release -sdk iphonesimulator6.1\nxcodebuild -workspace Analytics.xcworkspace -scheme Analytics -configuration Release -sdk iphoneos6.1\n\n## Combine the two separate libAnalytics.a into a single fat binary containing all 3 architectures\n# Use xcrun --find to avoid the infinite loop bug (at least on Tony's computer)\n`xcrun -sdk iphoneos6.1 --find lipo` -output \"${SYMROOT}/Release/libAnalytics.a\" -create \\\n\"${SYMROOT}/Release-iphoneos/libAnalytics.a\" \\\n\"${SYMROOT}/Release-iphonesimulator/libAnalytics.a\"\n\n## Merge bundled libriaries and libAnalytics into the final framework library\nlibtool -static -o \"${PRODUCT_PATH}/Versions/A/Analytics\" \\\n\"${SYMROOT}/Release/libAnalytics.a\" \\\n\"${PODS_ROOT}/GoogleAnalytics-iOS-SDK/libGoogleAnalyticsServices.a\" \\\n\"${PODS_ROOT}/FlurrySDK/Flurry/libFlurry_4.2.3.a\" \\\n\"${PODS_ROOT}/Chartbeat/libChartbeat-iOS-SDK.a\"\n\n## Copy headers into the framework\n# The -a ensures that the headers maintain the source modification date so that we don't constantly\n# cause propagating rebuilds of files that import these headers.\n/bin/cp -a \"${SYMROOT}/Release-iphoneos/AnalyticsHeaders/\" \"${PRODUCT_PATH}/Versions/A/Headers/\"\n\n# Zip up the framework and license for distribution, and open products folder\ncd \"${SYMROOT}/Release\"\ncp \"${PROJECT_DIR}/License.md\" .\nzip -r Analytics.zip Analytics.framework License.md\nopen .\n";
